        There are many ways to calculate the number of ways to arrange $n$ objects
        in a row, depending on how we define "row." Here are three common methods:


        Method 1: Multiplication Formula

        The multiplication formula is one of the most popular methods for counting
        the number of ways to arrange objects in a row. It states that the number
        of ways to arrange $n$ objects in a row is equal to $n!$. This formula works
        because each object can be placed in any position in the row, and we need
        to choose one position for each object.

        For example, if we have 5 objects to arrange in a row, there are $\boxed{5!
        = 5 \times 4 \times 3 \times 2 \times 1 = 120}$ ways to do so.


        Method 2: Combination Formula

        Another way to count the number of ways to arrange objects in a row is using
        the combination formula. This formula states that the number of ways to arrange
        $n$ objects in a row is equal to $\frac{n!}{k! (n - k)!}$, where $k$ is the
        number of objects we want to place in the first row.

        For example, if we have 5 objects to arrange in a row with 3 objects in the
        first row, there are $\boxed{\frac{5!}{3! (2!) = 10}$ ways to do so}$.


        Method 3: Recurrence Relation

        A third way to count the number of ways to arrange objects in a row is using
        a recurrence relation. This method involves defining a recurrence relation
        for the number of ways to arrange $n$ objects in a row, and then solving it
        inductively to find the solution.

        For example, if we define the recurrence relation $a_n = a_{n - 1} + a_{n
        - 2}$, where $a_n$ is the number of ways to arrange $n$ objects in a row,
        we can solve it inductively to find that there are $\boxed{a_n = n!}$ ways
        to arrange $n$ objects in a row.

